import React from 'react';

import { NavLink } from 'react-router-dom';

import './NavBar.css';

const NavBar = (props) => {
    let Home = null;
    let Join = null;
    let Login = null;
    let SignUp = null;

    if(props.displayHome) {
        Home = (
            <li className="leftPart-listitem"><NavLink className="link" to='/'>Home</NavLink></li>
        );
    }
    if(props.displayJoin) {
        Join = (
            <li className="leftPart-listitem"><NavLink className="link" to='/join'>Join</NavLink></li>
        );
    }
    if(props.displayLogin) {
        Login = (
            <li className="rightPart-listitem"><NavLink className="link" to='/login'>Login</NavLink></li>
        );
    }
    if(props.displaySignUp) {
        SignUp = (
            <li className="rightPart-listitem"><NavLink className="link" to='/signup'>SignUp</NavLink></li>
        );
    }

    return (
        <header className="header">
            <nav className="navBar">
                <ul className="leftPart-itemlist">
                    {Home}
                    {Join}
                </ul>
                <ul className="rightPart-itemlist">
                    {Login}
                    {SignUp}
                </ul>
            </nav>
        </header>
    );
};

export default NavBar;
